import * as React from 'react';
import Tabs from '@mui/material/Tabs';
import Tab from '@mui/material/Tab';
import Box from '@mui/material/Box';
import Typography from '@mui/material/Typography';
import {
  Card,
  CardContent,
  FormControl,
  InputLabel,
  MenuItem,
  Select,
  Grid,
} from "@mui/material";

export default function IconPositionTabs() {
  const [value, setValue] = React.useState(0);
  const [tabIndex, setTabIndex] = React.useState(0);
  const [zone, setZone] = React.useState("");
  const [cluster, setCluster] = React.useState("");
  const [envNumber, setEnvNumber] = React.useState("");

  const clusterOptions = {
    NCZ: ["DEV", "IN5", "RAT", "SYS"],
    DPZ: ["RAT", "EXT", "ORT"],
  };

  const handleZoneChange = (event) => {
    setZone(event.target.value);
    setCluster("");
  };

 const handleTabChange = (event, newIndex) => {
    setTabIndex(newIndex);
  };

  const handleChange = (event: React.SyntheticEvent, newValue: number) => {
    setValue(newValue);
  };

  return (
    <Box>

      <Tabs value={tabIndex} onChange={handleChange} aria-label="icon position tabs example">
        <Tab label="Requestor/Group Details" />
        <Tab label="Environment Variables" />
        <Tab label="Application Specs" />
        <Tab label="Kafka Topics" />
      </Tabs>


      <Box sx={{ p: 2 }}>
        {value === 0 && (
          <Typography variant="body1">Requestor/Group Details Content</Typography>
        )}
        {value === 1 && (
          <Typography variant="body1">Environment Variables Content</Typography>
        )}
        {value === 2 && (
          <Typography variant="body1">Application Specs Content</Typography>
        )}
        {value === 3 && (
          <Typography variant="body1">Kafka Topics Content</Typography>
        )}
      </Box>




    {tabIndex === 1 && (
        <Card sx={{ mt: 2 }}>
          <CardContent>
            <h2>Environment Variables</h2>
            <Grid container spacing={2}>
              {/* Zone Selection */}
              <Grid item xs={12}>
                <FormControl fullWidth>
                  <InputLabel>Zone</InputLabel>
                  <Select value={zone} onChange={handleZoneChange}>
                    <MenuItem value="NCZ">NCZ</MenuItem>
                    <MenuItem value="DPZ">DPZ</MenuItem>
                  </Select>
                </FormControl>
              </Grid>

              {/* Cluster Selection */}
              <Grid item xs={12}>
                <FormControl fullWidth disabled={!zone}>
                  <InputLabel>Cluster</InputLabel>
                  <Select value={cluster} onChange={(e) => setCluster(e.target.value)}>
                    {zone &&
                      clusterOptions[zone].map((clusterName) => (
                        <MenuItem key={clusterName} value={clusterName}>
                          {clusterName}
                        </MenuItem>
                      ))}
                  </Select>
                </FormControl>
              </Grid>

              {/* Environment Number Selection */}
              <Grid item xs={12}>
                <FormControl fullWidth>
                  <InputLabel>Environment Number</InputLabel>
                  <Select value={envNumber} onChange={(e) => setEnvNumber(e.target.value)}>
                    {[...Array(101).keys()].map((num) => (
                      <MenuItem key={num} value={num}>
                        {num}
                      </MenuItem>
                    ))}
                  </Select>
                </FormControl>
              </Grid>
            </Grid>
          </CardContent>
        </Card>
      )}








    </Box>
  );
}
